// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/access/Ownable.sol";

contract VRFReflexBlitz is Ownable {
    uint256 public constant PLAY_PRICE = 0.01 ether; // 0.01 MON (1e16)
    uint256 public constant FREE_PLAY_INTERVAL = 1 hours;

    mapping(address => uint256) public lastPlayTime;

    event FlashRequested(address indexed player, uint256 requestTimestamp, bool isFreePlay);
    event FundsWithdrawn(address indexed owner, uint256 amount);

    constructor() Ownable() {
        // Owner is set to deployer
    }

    function requestFlash() external payable {
        bool isFree = (block.timestamp - lastPlayTime[msg.sender]) >= FREE_PLAY_INTERVAL;

        if (isFree) {
            // Free play, no payment required, but ensure no value was sent accidentally
            require(msg.value == 0, "VRFReflexBlitz: Value sent for free play");
        } else {
            require(msg.value == PLAY_PRICE, "VRFReflexBlitz: Incorrect play price");
        }

        lastPlayTime[msg.sender] = block.timestamp;
        emit FlashRequested(msg.sender, block.timestamp, isFree);
    }

    function getRemainingFreePlayCooldown(address player) external view returns (uint256) {
        uint256 timeSinceLastPlay = block.timestamp - lastPlayTime[player];
        if (timeSinceLastPlay >= FREE_PLAY_INTERVAL) {
            return 0;
        }
        return FREE_PLAY_INTERVAL - timeSinceLastPlay;
    }

    function withdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "VRFReflexBlitz: No balance to withdraw");
        payable(owner()).transfer(balance);
        emit FundsWithdrawn(owner(), balance);
    }

    // Fallback and Receive to accept direct payments if necessary (though primary is via requestFlash)
    receive() external payable {}
    fallback() external payable {}
}

